function Ruokalista(props) {
    if (props.ruoat.length === 0) {
        return (<p> Matkoja ei ole </p>);
      }
    return (
        <div>
            {
                props.ruoat.map(tieto => {
                    return (
                        <p key={tieto.id}>
                            Ruoan nimi: {tieto.nimi}<br />
                            Päivämäärä: {tieto.pvm}<br />
                            Kellonaika: {tieto.aika}<br />
                            Lisätietoja: {tieto.lisatiedot}<br />
                        </p>
                    ) // return
                }) // map
            }
        </div>
    )
}
export default Ruokalista;
